import React, { useState, useEffect } from 'react';
import { Icon, Menu, Input, Segment, Header, Grid, GridColumn } from 'semantic-ui-react';
import axios from 'axios';

const NavBar = () => {
    const [loading, setLoading] = useState(false);
    const [results, setResults] = useState([]);
    const [value, setValue] = useState('');

    const handleSearchChange = async (e, data) => {
        setLoading(true);
        setValue(data.value);

        try {
            const response = await axios.get(`http://localhost:8000/userAuth/search?query=${data.value}`);
            setResults(response.data);
        } catch (error) {
            console.error('Error searching:', error);
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className="flex flex-col">
            {/* TOPBAR */}
            <div className="flex items-center justify-between p-4 bg-white text-white h-16 fixed w-full z-10">
                <div className="flex items-center justify-start w-1/3">
                    <img src="https://react.semantic-ui.com/logo.png" alt="App Logo" className="h-10 w-10" />
                </div>
                <div className="flex items-center justify-center w-1/3">
                    <Input
                        icon="search"
                        placeholder="Search..."
                        className="mr-4"
                        size='big'
                        loading={loading}
                        value={value}
                        onChange={handleSearchChange}
                    />
                </div>
                <div className="flex items-center justify-end w-1/3">
                    <Icon name="sun" size="big" className="mr-4 cursor-pointer" color="black" />
                    <Icon name="settings" size="big" className="mr-4 cursor-pointer" color="black" />
                    <Icon name="user circle" size="big" className="cursor-pointer" color="black" />
                </div>
            </div>
            {/* CONTENT */}
            <div className="flex mt-16">
                {/* SIDEBAR */}
                <Menu vertical fixed="left" className="h-full w-56 bg-white" style={{ marginTop: '4rem' }}>
                    <Menu.Item>
                        <Icon name="home" />
                        Home
                    </Menu.Item>
                    <Menu.Item>
                        <Icon name="chart bar" />
                        Activity
                    </Menu.Item>
                    <Menu.Item>
                        <Icon name="chat" />
                        Chat
                    </Menu.Item>
                    <Menu.Item>
                        <Icon name="calendar" />
                        Calendar
                    </Menu.Item>
                    <Menu.Item>
                        <Icon name="settings" />
                        Settings
                    </Menu.Item>
                </Menu>
                {/* Display search results */}
                <GridColumn width={10}>
                    <Segment>
                        <Header>Search Results</Header>
                        <pre style={{ overflowX: 'auto' }}>
                            {JSON.stringify(results, null, 2)}
                        </pre>
                    </Segment>
                </GridColumn>
            </div>
        </div>
    );
};

export default NavBar;
